import React from 'react'
import Mainlayout from '../layout/mainlayout'


function Workshops() {
    $("#workshops").click(function () {
        $("workshops").addClass("active");
    });
    return (
        <>
            <Mainlayout>
                <h1>this is my workshops page</h1>
            </Mainlayout>
        </>

    )
}

export default Workshops
